let temp = 28;
BronzeIoTData
| where temperature > temp

// This KQL query was generated by AI:
// filter my data by temperature higher than 25, group it by partition and render it with a column chart
//
BronzeIoTData
| where temperature > 25
| summarize countPartitionId=count() by PartitionId
| render barchart 
    with (
        title="Count by PartitionId (Temperature > 25)",
        ytitle="Count",
        xtitle="PartitionId",
        legend=hidden
    )
